import React from 'react';
import s from './Dialogs.module.css';
import {NavLink} from "react-router-dom";

const DialogItem = (props) => {
    let path = "/dialogs/" + props.id;

    return (
        <div className={s.dialog}>
            <NavLink to={path}>{props.name}</NavLink>
        </div>
    )
}

const Message = (props) => {
    return (
        <div className={s.message}>{props.massage}</div>
    )
}

const Dialogs = (props) => {

    let dialogs = [
        {id: 1, name: "Max"},
        {id: 2, name: "Angelika"},
        {id: 3, name: "Aneta"},
        {id: 4, name: "Zoja"},
        {id: 5, name: "Andjei"},
        {id: 6, name: "Marysia"},
    ];

    let messages = [
        {id: 1, message: "Hi"},
        {id: 2, message: "How is your day?"},
        {id: 3, message: "You"},
        {id: 4, message: "You"},
        {id: 5, message: "You"},
    ];

    let dialogsElements = dialogs
        .map((d) => <DialogItem name={d.name} id={d.id}/>)

    let messageElements = messages
        .map((m, index) => <Message massage={m.message}/>)

    return (
        <div className={s.dialogs}>
            <div className={s.dialogItems}>
                <DialogItem name={dialogs[0].name} id={dialogs[0].id}/>
                <DialogItem name={dialogs[1].name} id={dialogs[1].id}/>
                <DialogItem name={dialogs[2].name} id={dialogs[2].id}/>
                <DialogItem name={dialogs[3].name} id={dialogs[3].id}/>
                <DialogItem name={dialogs[4].name} id={dialogs[4].id}/>
                <DialogItem name={dialogs[5].name} id={dialogs[5].id}/>
            </div>
            <div className={s.messages}>
                <Message massage={messages[0].message}/>
                <Message massage={messages[1].message}/>
                <Message massage={messages[2].message}/>
                <Message massage={messages[3].message}/>
                <Message massage={messages[4].message}/>
            </div>
        </div>
    )
};

export default Dialogs;
